import styled from 'styled-components';

export const Perfil = styled.div `
  height: 100vh;
  display: grid;
  grid-column-start: 2;
  grid-column-end: 3;
  background-color: black;

  > nav {
    grid-column-start: 1;
    grid-column-end: 2;
    height: 100vh;
    display: flex;
    flex-direction: column;

    > Button {
      height: 25vh;
      font-size: 2vw;
    }
  }

`;
